import React from 'react';
import TeacherList from './components/TeacherList';

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <h1>Teacher Management</h1>
        </header>
        <main>
          <TeacherList />
        </main>
      </div>
  );
}

export default App;
